import React from "react";
import "../css/ProductHome.css";

function ProductHome() {
  return (
    <div className="ProductHome">
      <div className="ProductHome-right">
        <form action="/product" encType="multipart/form-data" method="post">
          <div className="ProductForm">
            <img className="upload-img" src="/public/upload-img.png"></img>
            <input type="file" name="file-to-upload"></input>
            <input type="submit" value="Upload"></input>
          </div>
        </form>
      </div>
      <div>
        <h3>Some content</h3>
      </div>
    </div>
  );
}

export default ProductHome;
